import { API, wrapPromise } from 'utils/api';

// function fetchTopbanner() {
// 	return API.get('web/jobsFeed/advertisments');
// }

const fetchUserProfile = ({ userId, jwt }) =>
	wrapPromise(
		API.get(`web/profile/${userId}`, {
			headers: {
				'x-access-token': jwt,
			},
		}),
	);

export const fetchProfileData = () => {
	return {
		baseProfile: fetchUserProfile(),
		resumeProfile: fetchUserProfile(),
	};
};
